import React from 'react'
import './Login.css'

function LoginForm({ handleNavigation, handleSubmit }) {
    return (
        <div className="form-container">
            <h2>Iniciar Sesión</h2>
            <form className="form" onSubmit={handleSubmit}>
                <div className="form-field">
                    <label>Email:</label>
                    <input type="email" />
                </div>
                <div className="form-field">
                    <label>Contraseña:</label>
                    <input type="password" />
                </div>
                <button className="form-button" type="submit">Iniciar Sesión</button>
            </form>
            <p>¿No tienes cuenta? <a href="#" onClick={() => handleNavigation('register')}>Crea una aquí</a></p>
            <a>Olvidé mi contraseña</a>
        </div>
    );
}

function RegisterForm({ handleNavigation, handleSubmit }) {
    return (
        <div className="form-container">
            <h2>Registro</h2>
            <form className="form" onSubmit={handleSubmit}>
                <div className="form-field">
                    <label>Nombre:</label>
                    <input type="text" />
                </div>
                <div className="form-field">
                    <label>Apellido:</label>
                    <input type="text" />
                </div>
                <div className="form-field">
                    <label>Email:</label>
                    <input type="email" />
                </div>
                <div className="form-field">
                    <label>Contraseña:</label>
                    <input type="password" />
                </div>
                <button className="form-button" type="submit">Crear cuenta</button>
            </form>
        </div>
    );
}

function Login({ currentPage, handleNavigation, handleSubmit }) {
    return (
        <div>
            {currentPage === 'login' && <LoginForm handleNavigation={handleNavigation} handleSubmit={handleSubmit} />}
            {currentPage === 'register' && <RegisterForm handleNavigation={handleNavigation} handleSubmit={handleSubmit} />}
        </div>
    );
}

export default Login;
